  true,\n\t\"url\": null,\n\t\"notes\": \"The level 1B waveform parameterization data
  will contain waveform-based range corrections and surface characteristics at the
  full 40 per second resolution. Data granules will contain approximately 23 minutes
  (1/4 orbit) of data. (Suggested Usage: GLAH05 contains scientific investigations
  of surface features defined by the waveform parameterization. File contains range
  corrections and the parameterizations of the waveform that were used to calculate
  surface elevation, and other surface characteristics. The data values were used
  as input data values to compute parameters on GLAH06 and GLAH12-15. Each GLAH05
  file was created from an equivalent GLA05 binary formatted file. The provenance
  metadata shows the history that created the GLA05.)\",\n\t\"license_title\": \"U.S.
